const HOME = 'HOME';

const initialState = {
  socImages: [
    { iconSrc: '' },
    { iconSrc: 'https://www.instagram.com/static/images/ico/favicon-200.png/ab6eff595bb1.png', iconAlt: 'instagram' },
    { iconSrc: '', iconAlt: '' },
    { iconSrc: '', iconAlt: 'gmail' },
    { iconSrc: '', iconAlt: 'youtube' },

  ]
}

export default function HomeReducer(state = initialState, action) {

  switch (action.type) {
    default:

      return state;
  }
}
